import React from 'react';
import { Menu, Row, Col } from 'antd';            // https://ant.design/components/menu/
import styled from 'styled-components';

const Background = styled.div`
    width: 100%;
    height: 100vh;
    background-color: #FFFFFF
`

const MyMenu = styled.ul`
    list-style-type: none;
`

const HELP = () => {
    return (
        <div id="help" style={{width: '100%', height: '100vh', backgroundColor: '#FFFFFF'}}>
        <Row>
            <Col xs={24} md={12} >
            </Col>
            <Col xs={24} md={12} >
                <div>
                    <MyMenu>
                        <li><a style={{color: '#000000', display: 'inline'}}>HOME</a></li>
                        <li><a style={{color: '#000000', display: 'inline'}}>ABOUT</a></li>
                        <li><a style={{color: '#000000', display: 'inline'}}>CHARACTOR</a></li>
                        <li><a style={{color: '#000000', display: 'inline'}}>HELP</a></li>
                    </MyMenu>
                </div>
            </Col>
        </Row>

    </div>
    );
};

export default HELP;
